n  // --- for reactive form\n  subscriptionFrom: FormGroup;\n\n  private savedSubscription : SubscriptionsDetails;\n\n  constructor(private frm: FormBuilder, private subscriptionService: SubscriptionService, public toster: ToastrManager) { }\n\n  ngOnInit() {\n    // --- fro reactive form\n    this.subscriptionFrom = this.frm.group({\n      planName: [\"\",Validators.required],\n      noOfCustomer: [\"\",Validators.required],\n      noOfSurvey: [\"\",Validators.required],\n      noOfSubmission: [\"\",Validators.required],\n      validMonths: [\"\"]\n    });\n  }\n  \n  ngOnDestroy() {\n    // --- unsubscribe all subscribe methode \n    this.subscription.unsubscribe();\n}\n\n  get f(){\n    return this.subscriptionFrom.controls;\n  }\n\n\n  onsubmit() {\n    console.log(this.subscriptionFrom.value)\n     // --- add subscribe methode to the subscription object\n     this.subscription.add(\n\n      this.subscriptionService.saveSubscription(this.subscriptionFrom.value).subscribe(data => {\n        console.log(data);\n  \n        this.savedSubscription = data;\n        this.toster.successToastr(\"success\", \"data successfully saved\", {position:\"bottom-right\", animate: \"slideFromBottom\"})\n        this.subscriptionService._set_ngxModal_add(true);\n        this.subscriptionService._addSubscribeToList.next(this.savedSubscription);\n      }, err => {\n        console.log(err);\n        this.toster.errorToastr(JSON.parse(JSON.stringify(err)).error.message, \"Error\", {position:\"bottom-right\", animate: \"slideFromBottom\"})\n        this.subscriptionService._set_ngxModal_add(true);\n      })\n      \n     );\n\n   \n  }\n\n  // --- set the validmonths fro selected plan   xxxx\n  onSelectedCPlanName(plan: String) {\n    console.log(plan);\n\n    switch (plan) {\n      case (\"A\"):\n        this.subscriptionFrom.get('validMonths').patchValue(1);\n        break;\n\n      case (\"B\"):\n        this.subscriptionFrom.get('validMonths').patchValue(2);\n        break;\n\n      case (\"C\"):\n        this.subscriptionFrom.get('validMonths').patchValue(3);\n        break;\n\n      case (\"D\"):\n        this.subscriptionFrom.get('validMonths').patchValue(4);\n        break;\n\n      default:\n        this.subscriptionFrom.get('validMonths').patchValue(\"select Plan Name\");\n        break;\n\n    }\n  }\n\n\n}\n\n    \n\n    \n        \n \n  \n  \n\n     \n\n              \n\n                    \n                      \n                          plan\n                          \n                              Plan A\n                              Plan B\n                              Plan C\n                              Plan D\n                        \n                                                \n                          planName is required\n                       \n                      \n\n                      \n                          valid Months\n                              \n                      \n\n                      \n                      \n                        number of  customer\n                         \n                                                \n                          No of customer is required\n                       \n                      \n\n              \n\n\n              \n\n                      \n                        number of survey \n                         \n                                                \n                          No of customer is required\n                       \n                      \n\n\n                      \n                          number Of submission\n                          \n                                                  \n                            No of customer is required\n                         \n                        \n\n              \n\n\n                      \n                        Submit\n                      \n\n\n\n    \n\n\n\n\n  \n\n\n    \n\n    \n                \n                    ./subscription-add.component.c